import React from 'react'
import { FaBars } from 'react-icons/fa';
import { Link } from "react-router-dom";

function SideNav() {
	return (
		<div>
			<Link to="#" className='Menu Bars'>
				<FaBars/>
			</Link>
		</div>
	)
}

export default SideNav
